Cool down and chill out  with a specialty, the New Orleans Original Daiquiris. @Bayoubakery frozen drinks flow from our new daiquiri machine into our grab n’ geaux containers! We have pouches and quarts and even half gallons for the real guzzlers! Frosty flavors include the Hurricane, but, my personal favorite is The Dude - a nod to the most famous cocktail to hit the big screen, other than the martini, a White Russian – paying tribute to Jeff Bridges’ memorable character in my favorite film, The Big Lebowski. 🍹🧊

